/**
 * @param {string} s
 * @return {number}
 */
var maxOperations = function(s) {
    let arr = s.split('');
    let res = 0;let temp =0;
    for(let i=0;i<arr.length;) {
        let cur = arr[i];
        if(cur === '1') {
            temp++;
        } else if(cur === '0') {
            while(i+1 < arr.length && arr[i+1] === '0') {
                i++;
            }
            res+=temp;
        }
        i++;
    }
    return res;
};
